import React, { Component } from 'react'

export default class FormContainer extends Component {
    render() {
        return (
            <div>
                <h2>Purchase Stocks</h2>

                <h5>Your Balance - $5000.00</h5>

                <form>
                    <label for="ticker">Ticker:</label><br/>
                    <input type="text" id="ticker" name="ticker" placeholder="AMZN"></input><br/><br/>
                    <label for="ticker">Quantity:</label><br/>
                    <input type="number" id ="quantity" name="quantity" placeholder= "1"></input><br/><br/>
                    <input type="submit" value="Buy"></input>
                </form>

            </div>
        )
    }
}
